import React from 'react';  
import './createfolder.css';  
import { InputBase, TextField, Button, Typography } from '@material-ui/core';

class CreateFolderPopup extends React.Component {  

    constructor(props){
        super(props);
        this.state = {
            name: null,
            type: null,
            icon: null
        };

        this._onEscapeKeyPress = (e) => {
            if(e.keyCode === 27) this.onDelete();
        };
    }


    onSave(e) {
        e.preventDefault();

    }

    render() {  
        return (  
            <div className='popup'>  
                <div className='popup_inner'>  
                    <h5>New Folder</h5>  
                    <form noValidate autoComplete="off"
                        onSubmit = {this.onSave.bind(this)}>
                        <TextField id="standard-basic" label="Untitled Folder" />
                    </form>
                    <div>
                        <Button onClick={this.props.closePopup}>
                            <Typography>
                                CLOSE
                            </Typography>
                        </Button> 
                        <Button>
                            <Typography>
                                CREATE
                            </Typography>
                        </Button> 
                    </div>
                </div>  
            </div>  
            );  
        }  
    }  

export default CreateFolderPopup;
